import React, { Component } from "react";
import HomePhoto from "../assets/homephoto2.png";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import "../styles/homeView.css";

class HomeView extends Component {
  render() {
    return (
      <React.Fragment>
        <div
          style={{
            backgroundImage: "url(" + HomePhoto + ")",
            backgroundPosition: "center",
            backgroundSize: "cover",
            backgroundRepeat: "no-repeat",
            marginBottom: "0px",
          }}
          className="jumbotron jumbotron-fluid"
        >
          <Row className="row-lg-12 mb-5">
            <Col className="col-lg-6"></Col>

            <Col className="col-lg-6">
              <div className="container-lg homePageText">
                <h1 className="display-4">Photography made simple</h1>
                <Row className="row-lg-6">
                  <Col className="col-lg-6">
                    <p className="lead">
                      Need a talented individual to cover an
                      occasion? Browse through our list of curated
                      photographers or let us find one for you
                    </p>
                    <a className="btn btn-outline-light m-2 buts" href="/categories">
                      Book Now
                    </a>
                    <a className=" btn btn-outline-light buts m-2" href="/recommendation/none">
                      Recommendation
                    </a>
                  </Col>

                  <Col className="col-lg-6"></Col>
                </Row>
              </div>
            </Col>
          </Row>
        </div>
      </React.Fragment>
    );
  }
}

export default HomeView;
